import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import axios from "axios";

const STEP = {
  DASHBOARD: "DASHBOARD",
  ENTER_DATA: "ENTER_DATA",
  ANALYSIS_RESULT: "ANALYSIS_RESULT",
};

const DEFAULT_TRANSACTION = {
  date: "",
  description: "",
  credit: 0,
  debit: 0,
  balance: 0,
};

function App() {
  const [currentStep, setCurrentStep] = useState(STEP.DASHBOARD);
  const [transactions, setTransactions] = useState([DEFAULT_TRANSACTION]);
  const [analysis, setAnalysis] = useState(null);
  const [file, setFile] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileChange = async (e) => {
    const uploadedFile = e.target.files[0];
    if (!uploadedFile) {
      setError("No file selected.");
      return;
    }

    setIsLoading(true);
    setError(null);
    setFile(uploadedFile);

    try {
      const formData = new FormData();
      formData.append("file", uploadedFile);

      console.log("Sending file to backend...");
      const response = await axios.post(
        "http://localhost:8000/upload-pdf",
        formData,
        {
          headers: {
            "Content-Type": "multipart/form-data",
          },
        }
      );

      console.log("Response from backend:", response.data);

      // Update transactions based on the backend response
      if (response.data?.transactions) {
        setTransactions(
          response.data.transactions.map((txn) => ({
            date: txn.date,
            description: txn.description,
            credit: txn.credit,
            debit: txn.debit,
            balance: txn.balance,
          }))
        );
      } else {
        setError("No valid transactions found.");
        setTransactions([DEFAULT_TRANSACTION]);
      }
    } catch (error) {
      console.error("Error uploading PDF:", error);
      setError(
        error.response?.data?.detail ||
          "Error uploading PDF. Please try again."
      );
      setTransactions([DEFAULT_TRANSACTION]);
    } finally {
      setIsLoading(false);
    }
  };

  const handleAnalyze = async () => {
    const analysis = {
      total_income: transactions.reduce((sum, t) => sum + t.credit, 0),
      total_expenses: transactions.reduce((sum, t) => sum + t.debit, 0),
      net_flow: transactions.reduce(
        (sum, t) => sum + (t.credit - t.debit),
        0
      ),
      recommendation: transactions.reduce(
        (sum, t) => sum + (t.credit - t.debit),
        0
      ) > 500
        ? "APPROVED"
        : "DENIED",
    };

    setAnalysis(analysis);
    setCurrentStep(STEP.ANALYSIS_RESULT);
  };

  const renderFileUpload = () => (
    <div className="mb-4">
      <div className="flex items-center space-x-4">
        <input
          type="file"
          accept=".pdf"
          className="block"
          onChange={handleFileChange}
          disabled={isLoading}
        />
        {isLoading && <div className="text-blue-600">Loading...</div>}
      </div>
      {error && (
        <div className="text-red-600 text-sm mt-2">{error}</div>
      )}
    </div>
  );

  const renderMainContent = () => {
    switch (currentStep) {
      case STEP.DASHBOARD:
        return (
          <div>
            <h1 className="text-2xl font-bold mb-4">Dashboard</h1>
            {/* Dashboard content remains unchanged */}
          </div>
        );

      case STEP.ENTER_DATA:
        return (
          <div className="bg-white shadow p-4">
            <h2 className="text-lg font-semibold mb-4">Enter Transaction Data</h2>
            {renderFileUpload()}
            {/* Transaction table logic remains unchanged */}
          </div>
        );

      case STEP.ANALYSIS_RESULT:
        return (
          <div className="bg-white shadow p-4">
            <h2 className="text-lg font-semibold mb-4">Loan Analysis Result</h2>
            {analysis ? (
              <div>
                <p>Total Income: ${analysis.total_income.toFixed(2)}</p>
                <p>Total Expenses: ${analysis.total_expenses.toFixed(2)}</p>
                <p>Net Flow: ${analysis.net_flow.toFixed(2)}</p>
                <p>Recommendation: {analysis.recommendation}</p>
              </div>
            ) : (
              <p>No analysis available.</p>
            )}
          </div>
        );

      default:
        return <p>Invalid step. Please refresh the page.</p>;
    }
  };

  return (
    <div>
      <nav>{/* Navigation remains unchanged */}</nav>
      <main>{renderMainContent()}</main>
    </div>
  );
}

export default App;
